import React, { useEffect } from 'react';
import { withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import * as houseActions from '../actions/houseActions';
import List from './List';
import HiddenNav from './HiddenNav';

const IndexPage = ({ state, actions }) => {
  useEffect(() => {
    if (!state.authenticated) {
      history.push('/sign_in', null);
    }     
  }, []);

  return (
  <div style={{
    height: '100%', overflow: 'hidden', pointerEvents: 'none', backgroundColor: '#f7f5fa', zIndex: 1,
  }}
  >
    <List />
    <HiddenNav />
  </div>
  );
};

function mapStateToProps({ state }) {
  return { state: { ...state } };
}

function mapActionsToProps(dispatch) {
  return {
    actions: bindActionCreators({ ...houseActions }, dispatch),
  };
}

export default connect(mapStateToProps, mapActionsToProps)(withRouter(IndexPage));
